document.getElementById('dietForm').addEventListener('submit', function(event) {
    event.preventDefault();

    const goal = document.getElementById('goal').value;
    const activity = document.getElementById('activity').value;
    const allergies = document.getElementById('allergies').value;

    let dietPlan = "";

    if (goal === "weight_loss") {
        dietPlan += "<h2>Weight Loss Regimen</h2>";
        dietPlan += "<p>Focus on eating plenty of vegetables, fruits, and lean proteins. Limit your intake of refined carbohydrates and fatty foods.</p>";
    } else if (goal === "muscle_gain") {
        dietPlan += "<h2>Muscle Gain Mode</h2>";
        dietPlan += "<p>Eat plenty of protein from lean meats, eggs, and beans. Add complex carbohydrates from brown rice and oats to increase energy for your workout session.</p>";
    } else if (goal === "maintain") {
        dietPlan += "<h2>Maintenance Mode</h2>";
        dietPlan += "<p>Eat enough calories to maintain weight. Add foods rich in fiber and vitamins.</p>";
    } else if (goal === "vegan") {
        dietPlan += "<h2>Vegetarian Diet</h2>";
        dietPlan += "<p>A plant-based diet such as vegetables, fruits, nuts, and tofu. Supplement vitamin B12 and iron from plant sources or supplement from pills.</p>";
    }

    if (activity === "sedentary") {
        dietPlan += "<p>You have low activity levels, so pay attention to eating well and keeping your calorie levels balanced.</p>";
    } else if (activity === "light") {
        dietPlan += "<p>You have a light activity level, so you can add a little more carbohydrates to provide energy.</p>";
    } else if (activity === "moderate") {
        dietPlan += "<p>You exercise moderately, increase your protein and good fat intake to maintain muscle.</p>";
    } else if (activity === "active") {
        dietPlan += "<p>You are very active, so increase your calories and protein intake to provide enough energy for your body.</p>";
    }

    if (allergies) {
        dietPlan += `<p><strong>Note:</strong> You are allergic to ${allergies}. Avoid foods containing this substance in your diet.</p>`;
    }

    const resultDiv = document.getElementById('result');
    resultDiv.innerHTML = dietPlan;
    resultDiv.style.display = "block";
});
// function resugges
document.getElementById('recipeForm').addEventListener('submit', function(event) {
    event.preventDefault();

    const ingredients = document.getElementById('ingredients').value.split(',').map(item => item.trim());
    const suggestedRecipes = getRecipeSuggestions(ingredients);

    displayRecipes(suggestedRecipes);
});

function getRecipeSuggestions(ingredients) {
    const recipes = {
        "Chicken Stir Fry": {
            ingredients: ["Chicken", "Broccoli", "Bell Pepper"],
            image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQFM-nQOvso8zkNCKFf9yyRgH6bBTsPq4g21g&s" // replace with actual image URL
        },
        "Vegetable Fried Rice": {
            ingredients: ["Rice", "Carrot", "Peas"],
            image: "data:image/jpeg;base64," // replace with actual image URL
        },
        "Chicken Salad": {
            ingredients: ["Chicken", "Lettuce", "Tomato"],
            image: "data:image/jpeg;base64," // replace with actual image URL
        },
        "Pasta Primavera": {
            ingredients: ["Pasta", "Broccoli", "Carrot"],
            image: "data:image/jpeg;base64," // replace with actual image URL
        },
        "Omelette": {
            ingredients: ["Eggs", "Tomato", "Spinach"],
            image: "data:image/jpeg;base64," // replace with actual image URL
        }
    };

    const suggestions = [];

    for (const [recipe, data] of Object.entries(recipes)) {
        if (data.ingredients.every(ingredient => ingredients.includes(ingredient))) {
            suggestions.push({ name: recipe, image: data.image });
        }
    }

    return suggestions.length > 0 ? suggestions : [{ name: "No recipes found with the provided ingredients.", image: "" }];
}

function displayRecipes(recipes) {
    const recipesList = document.getElementById('recipesList');
    recipesList.innerHTML = '';

    recipes.forEach(recipe => {
        const li = document.createElement('li');

        if (recipe.image) {
            const img = document.createElement('img');
            img.src = recipe.image;
            img.alt = recipe.name;
            li.appendChild(img);
        }

        li.appendChild(document.createTextNode(recipe.name));
        recipesList.appendChild(li);
    });
}
